import Link from 'next/link';

const Foot = () => (
  <div id="footer">
    <ul>
      <li><Link href="/"><a>- Home</a></Link></li>
      <li><Link href="/contact"><a>- Get In Touch</a></Link></li>
      <li><Link href="/about"><a>- Learn About Us</a></Link></li>
    </ul>
    <style jsx>{`
      #footer {
        float: left;
        width: 80%;
        background: rgba(0,0,0,.2);
        padding: 10%;
      }
      ul {
        float: left;
        width: 40%;
      }
      li {
        float: left;
        width: 100%;
      }
      `}</style>
  </div>
);

export default Foot;
